	<script type="text/javascript" charset="utf-8">
		var map;
		
		function loadPlacemarks()
		{
			$.getJSON('http://localhost/nextstore/index.php/app/geo/fetch_placemarks', function(json) {
				
				if (json.length > 0) {
						
					for (_i=0; _i < json.length; _i++) {
												 
						var path = new google.maps.LatLng(json[_i].lat,json[_i].lng);
						
						var title = json[_i].title;
						
						addPlacemark(path, title);
						
					}
										
				}
				
			});
				
		}
		
		function addProgress(i, total)
		{
			var step = total/100*i;
			
			$('.bar').css({width: step+'%'});
			
		}
		
		
		function loadScript()
		{
			$.getJSON('http://localhost/nextstore/index.php/app/geo/fetch_bounds/3/1', function(json) {

				if (json.length > 0) {
					
					var total = json.length;
					
					for (_i=0; _i < json.length; _i++) {
						
						var correlation = json[_i].correlation;
						var title = json[_i].title;
						var zip = json[_i].coordinates;
						var vl = json[_i].vl;
								
						var path = [];
				
						for (var i = 0; i < zip.length; i++){
					
							var coord = zip[i];
													
							path.push(new google.maps.LatLng(coord[0], coord[1]));
					
						}
						
						addPolygon(path, correlation, vl,title);
						addProgress(_i, total);			
					}
					
				}

			});
						
		}

		
		function initialize() {

		  var mapOptions = {
		    zoom: 8,
		    center: new google.maps.LatLng(52.275879,5.189377),
				mapTypeId: google.maps.MapTypeId.ROADMAP,
				mapTypeControl: false,
				mapTypeControlOptions: {
					style: google.maps.MapTypeControlStyle.HORIZONTAL_BAR,
					position: google.maps.ControlPosition.TOP_RIGHT
					},
				panControl: false,
				streetViewControl: false,
				scaleControl: false,
				zoomControl: true,
				zoomControlOptions: {
					style: google.maps.ZoomControlStyle.LARGE,
					position: google.maps.ControlPosition.RIGHT_TOP
					}
				};

		  map = new google.maps.Map(document.getElementById('canvas'), mapOptions);
			
			loadScript();
			loadPlacemarks();
			
		}
		
		$(document).ready(function(){
			
			initialize();
			
			$('#data').dataTable({
				"bLengthChange": false,
				"bFilter": false,
				"bPaginate": false,
				"bInfo": false,
				"bAutoWidth": false,
				"aaSortingFixed": [[0,'asc']],
				"aoColumnDefs": [
					{"bSearchable": false, "bVisible": false, "aTargets": [ 0 ]},
					],
				"aoColumns": [{"sClass": "left" },{"sClass": "left"},{"sClass": "right"},{"sClass": "right"}]
				
				});
			
			$('#bigdata').dataTable({
				"bAutoWidth": false,
				"bLengthChange": false,
				"iDisplayLength": 40,
		    "oLanguage": {
		      "sSearch": ""
		    },
				"aoColumns": [{"sClass": "left" },{"sClass": "right"},{"sClass": "right"},{"sClass": "right"}]
				});
			
		});

		</script>
		
